pcl::visualization::PCLVisualizer::updatePointCloud(consttypenamepcl::PointCloud<PointT>::ConstPtr&cloud,
constPointCloudColorHandler<PointT>&color_handler,
conststd::string &id)
{
// Check to see if this ID entry already exists (has it been already added to the visualizer?)
autoam_it = cloud_actor_map_->find (id);

if(am_it == cloud_actor_map_->end ())
return(false);

// Get the current poly data
vtkSmartPointer<vtkPolyData>polydata =reinterpret_cast<vtkPolyDataMapper*>(am_it->second.actor->GetMapper ())->GetInput ();
if(!polydata)
return(false);

convertPointCloudToVTKPolyData<PointT>(cloud, polydata, am_it->second.cells);

// Get the colors from the handler
boolhas_colors =false;
doubleminmax[2];
if(autoscalars = color_handler.getColor())
{
// Update the data
polydata->GetPointData ()->SetScalars (scalars);
scalars->GetRange (minmax);
has_colors =true;
}

if(has_colors)
am_it->second.actor->GetMapper ()->SetScalarRange (minmax);

// Update the mapper
reinterpret_cast<vtkPolyDataMapper*>(am_it->second.actor->GetMapper ())->SetInputData (polydata);
return(true);
}

