pcl::visualization::PCLVisualizer::updateCorrespondences(
consttypenamepcl::PointCloud<PointT>::ConstPtr&source_points,
consttypenamepcl::PointCloud<PointT>::ConstPtr&target_points,
constpcl::Correspondences&correspondences,
intnth,
conststd::string &id,
intviewport)
{
return(addCorrespondences<PointT> (source_points, target_points, correspondences, nth,id, viewport,true));
}

updateCorrespondences(
consttypenamepcl::PointCloud<PointT>::ConstPtr&source_points,
consttypenamepcl::PointCloud<PointT>::ConstPtr&target_points,
constpcl::Correspondences&correspondences,
conststd::string &id="correspondences",
intviewport = 0)
{
// If Nth not given, display all correspondences
return(updateCorrespondences<PointT> (source_points, target_points,
correspondences, 1,id, viewport));
}
